import React, {useState} from 'react';
import './Realizations.css'
import { gsap, Power1 } from "gsap";

function Realizations() {


  return (
      <section className="realizations"  id="realizations">

        <div className="realization__current">
          <div className="realization__currentText"></div>
          <div className="realization__currentImage"></div>
        </div>

        <div className="realization__next">
          <div className="realization__nextImage"></div>
          <div className="realization__nextText"></div>
          <div className="realization__nextButtons">
            <div className="realization__nextButtons--next">></div>
            <div className="realization__nextButtons--prev"></div>
          </div>
        </div>

     </section>
  );
}

export default Realizations;
